import React, { useState } from 'react';
import Video from '../Video'
import Button from '../button'
import '../../App.css';
import home from './Home.module.css'
import Navbar from '../Navbar'
import Main from '../Main_hello'
import Music from '../Music'

// import Cards from '../Cards';
// import HeroSection from '../HeroSection';
// import Footer from '../Footer';

const Home = ()=> {
  const videoCode = '0koYzUectyA'
  const [musicSts, setMusicSt] = useState(null);

  const musicSt = (apple)=>{
    setMusicSt(apple)
    musicSts;
  }

  return(
  <div className={home.wrap} onMouseEnter={musicSt}>
      <Navbar className={'mainPage'}/>
      <Main></Main>
      <Video musicStart={musicSts}></Video>  
      <Music keys={musicSt} videoId={videoCode}></Music>
      {/* <Button className="position">click me</Button> */}
  </div>
);
};


export default Home;
